import { Form } from 'react-bootstrap';

const ContactForm = () => {
    return (
        <>
            <Form>
                <Form.Group  className = "p-3 m-3">
                    <Form.Control placeholder = "Enter your name" />
                </Form.Group>
            </Form>
        </>
    )
}

export default ContactForm
